window.bookSummaryJSON = "<p>If you play with fire, you're sure to get burned.</p> <p>The Powers that rule Morningstar believe death is a game, and my siblings and I are the unwilling players. The only way to be free is it to destroy the ascension contracts.</p> <p>So, I'm headed into the demon realm to convince the princes to do just that.</p> <p>I won't be going alone. I'll have Artimus as a guide, a bodyguard provided by the Duke of Flame, and my siblings. I know we can do this.</p> <p>But there are unseen forces determined to stop us. Forces that want to tear us apart and take us down.</p> <p>It's time to show our enemies that we're more than the sum of our parts. It's time to show them that together we're a force to be reckoned with.</p> <p>Contains mature themes.</p>"; 
